import React from "react";
import Layout from "../components/Layout";
import "../assets/Home.css";

const Home = () => {
  return (
    <Layout>
      <div className="home-container">
        <h1 className="home-header">Relatórios Financeiros</h1>

        {/* Seção dos 3 cards principais */}
        <div className="top-cards">
          <div className="stat-card">Rendimento Total<br/>R$ 0,00</div>
          <div className="stat-card">Gastos Totais<br/>R$ 0,00</div>
          <div className="stat-card">Valor Investido<br/>R$ 0,00</div>
        </div>

        {/* Seção dos gráficos */}
        <div className="dashboard-grid">
          <div className="chart-card">Gráfico de Categoria 1</div>
          <div className="chart-card">Gráfico de Categoria 2</div>
          <div className="chart-card">Gráfico de Categoria 3</div>
          <div className="chart-card">Gráfico de Categoria 4</div>
        </div>
      </div>
    </Layout>
  );
};

export default Home;
